import React from 'react';

export class Table extends React.Component {
    render() {
        return (
            <div>
                <tr className='contacts-table'>
                    Список контактов
                    <td>Имя</td>
                    <td>Фамилия</td>
                    <td>Телефон</td>
                </tr>
                <tr>
                    <td></td>
                    <td></td>
                    <td></td>
                </tr>
            </div>
        );
    }
}
